DROP TABLE IF EXISTS `ims_mask_user`;
CREATE TABLE `ims_mask_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL,
  `psw` varchar(50) NOT NULL COMMENT '密码',
  `openidh5` text,
  `openid` text NOT NULL,
  `img` varchar(200) NOT NULL,
  `level` int(2) DEFAULT '0' COMMENT '0-用户 1-代理 2-银卡 3-金卡 4-市代 5-省代',
  `total_score` int(11) NOT NULL COMMENT '积分',
  `user_tel` varchar(20) NOT NULL COMMENT '电话',
  `user_name` varchar(20) NOT NULL COMMENT '姓名',
  `wallet` decimal(10,2) NOT NULL COMMENT '钱包余额',
  `join_time` varchar(20) NOT NULL,
  `sex` int(2) DEFAULT '0' COMMENT '性别 0 男 1女',
  `qq` varchar(30) DEFAULT '',
  `wechat` varchar(50) DEFAULT '',
  `birthday` varchar(50) DEFAULT '',
  `address` varchar(200) DEFAULT '',
  `paypsw` varchar(100) DEFAULT NULL COMMENT '支付密码',
  `commission` decimal(10,2) NOT NULL COMMENT '佣金，目前没用到',
  `day` int(11) NOT NULL,
  `order_money` decimal(10,2) NOT NULL,
  `order_number` int(11) NOT NULL,
  `uniacid` int(11) NOT NULL,
  `dq_time` varchar(20) NOT NULL,
  `hy_day` int(11) NOT NULL,
  `nickname` varchar(50) DEFAULT NULL,
  `headerimg` varchar(200) DEFAULT NULL,
  `quyuid` int(2) DEFAULT '0' COMMENT '4-市代，5-省代',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=103617 DEFAULT CHARSET=utf8;

